import Banner from "components/Banner";
import styles from "./player.module.css";
import Titulo from "components/Titulo";

function Player() {
    return (
        <>
        <Banner img="player" />
        <Titulo >
            <h1>Player</h1>
        </Titulo>
        </>
    )
}

export default Player();
